import {Overlay} from "../../components/layout/Layout.Styled";

function Visual(props) {

  const {} = props;

  return (
      <Container>
          <Overlay/>
          <Text>
          <p>HELLO, I AM</p>
          <h1>Justin Lee</h1>
          </Text>

      </Container>
  )

}

const Container = styled.div`
  position:relative;
  height: 100vh;
  background: #fff url('https://www.beingeorge.com/justin/assets/images/slider3.jpg') 50% 50% / cover no-repeat;


`;
const Text = styled.div`
 p{
  font-size: 20px;
  color: #f0fff4;
  font-weight: 400;
  margin-bottom: 30px;
  }
  h1{
  font-size: 57px;
  color: #f0fff4;
  font-weight: 400;
  }
`;
export default Visual;
